import { SearchPage } from "components/pages/SearchPage";
import React from "react";
import { CurrentTabType } from "store/atoms/currentTabState";

export const ALL_TABS: {tabId: CurrentTabType, page: React.ReactNode }[] = [
  {
    tabId: 'search',
    page: <SearchPage />,
  },
  {
    tabId: 'add',
    page: <SearchPage />,
  },
  {
    tabId: 'settings',
    page: <SearchPage />,
  },
  {
    tabId: 'about',
    page: <SearchPage />,
  },
]
